const ToReadRecommendationsList = (props) => {
    return (
        <ul>
          {props.recommendations.map((recommendation) => (
            <li>
                <p>{recommenation.title}</p>
                <p>{recommenation.author}</p>
            </li>
          ))}
        </ul>
      );
};

export default ToReadRecommendationsList;
